SELECT ?native WHERE {
    ?native <dbpedia:birthPlace> <http://dbpedia.org/resource/Japan> .
    ?native <dbpedia:universityMember> <http://dbpedia.org/resource/University_of_Tsukuba> .
}

# Query 3: Determine the alma mater of Eiji Ōtsuka
