    <http://dbpedia.org/resource/Eiji_Otsuka> <dbpedia:almaMater> ?almaMater .
    ?almaMater <dbpedia:type> <http://dbpedia.org/ontology/EducationalInstitution> .
    ?almaMater <dbpedia:country> <http://dbpedia.org/resource/Japan> .
}

# Combine results
CONSTRUCT {
    ?combinedInfo native ?native;
    manager ?manager;
    almaMater ?almaMater
}
WHERE {
    UNION (
        SELECT ?native, ?manager FROM Query1
        SELECT ?native FROM Query2
    )
    INTERSECT
    (
        SELECT ?almaMater FROM Query3
    )
}
